import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route } from "react-router-dom";
import './App.css';
import Home from './Pages/Home';


function App() {
  return (
    <Routes>
      <Route path="/" exact={true} element={<Home />} />
    </Routes>
);
}

export default App;
